(1, 27, 'Joomla!', 'joomla', '', '<p>Congratulations, You have a Joomla! site! Joomla! makes your site easy to build a website just the way you want it and keep it simple to update and maintain. Joomla! is a flexible and powerful platform, whether you are building a small site for yourself or a huge site with hundreds of thousands of visitors. Joomla is open source, which means you can make it work just the way you want it to.</p>', '', 1, 1, 0, 0, '2008-08-12 10:00:00', 42, '', '2010-01-12 05:19:44', 42, 0, '0000-00-00 00:00:00', '2006-01-03 01:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 30, 0, 1, '', '', 1, 105, '{"robots":"","author":""}', 1, '', ''),
(2, 33, 'Great Barrier Reef', 'great-barrier-reef', '', '<p>The Great Barrier Reef is the largest coral reef system composed of over 2,900 individual reefs[3] and 900 islands stretching for over 3,000 kilometres (1,600 mi) over an area of approximately 344,400 square kilometres (133,000 sq mi). The reef is located in the Coral Sea, off the coast of Queensland in northeast Australia.</p><p>http://en.wikipedia.org/wiki/Great_Barrier_Reef</p>', '<p>The Great Barrier Reef can be seen from outer space and is the world''s biggest single structure made by living organisms. This reef structure is composed of and built by billions of tiny organisms, known as coral polyps. The Great Barrier Reef supports a wide diversity of life, and was selected as a World Heritage Site in 1981.CNN has labelled it one of the 7 natural wonders of the world. The Queensland National Trust has named it a state icon of Queensland.</p><p>A large part of the reef is protected by the Great Barrier Reef Marine Park, which helps to limit the impact of human use, such as overfishing and tourism. Other environmental pressures to the reef and its ecosystem include water quality from runoff, climate change accompanied by mass coral bleaching, and cyclic outbreaks of the crown-of-thorns starfish.</p><p>The Great Barrier Reef has long been known to and utilised by the Aboriginal Australian and Torres Strait Islander peoples, and is an important part of local groups'' cultures and spirituality. The reef is a very popular destination for tourists, especially in the Whitsundays and Cairns regions. Tourism is also an important economic activity for the region. Fishing also occurs in the region, generating AU$ 1 billion per year.</p>', 1, 0, 0, 24, '2009-06-22 11:07:08', 42, '', '2009-06-22 11:14:50', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","article-allow_ratings":"","article-allow_comments":"","show_author":"","show_create_date":"","show_modify_date":"","show_print_icon":"","show_email_icon":"","readmore":"","page_title":"","layout":""}', 1, 0, 0, '', '', 1, 2, '{"robots":"","author":""}', 0, '', ''),
(3, 34, 'Cradle Mountain-Lake St Clair National Park', 'cradle-mountain-lake-st-clair-national-park', '', '<p>Cradle Mountain-Lake St Clair National Park is located in the Central Highlands area of Tasmania (Australia), 165 km northwest of Hobart. The park contains many walking trails, and is where hikes along the well-known Overland Track usually begins. Major features are Cradle Mountain and Barn Bluff in the northern end, Mount Pelion East, Mount Pelion West, Mount Oakleigh and Mount Ossa in the middle and Lake St Clair in the southern end of the park. The park is part of the Tasmanian Wilderness World Heritage Area.</p><p>http://en.wikipedia.org/wiki/Cradle_Mountain-Lake_St_Clair_National_Park</p>', '<h3>Access and usage fee</h3><p>Access from the south (Lake St. Clair) is usually from Derwent Bridge on the Lyell Highway. Northern access (Cradle Valley) is usually via Sheffield, Wilmot or Mole Creek. A less frequently used entrance is via the Arm River Track, from the east.</p><p>In 2005, the Tasmanian Parks & Wildlife Service introduced a booking system & fee for use of the Overland Track over peak periods. Initially the fee was 100 Australian dollars, but this was raised to 150 Australian dollars in 2007. The money that is collected is used to finance the park ranger organisation, track maintenance, building of new facilities and rental of helicopter transport to remove waste from the toilets at the huts in the park.</p>', 1, 0, 0, 25, '2009-06-22 11:17:24', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","article-allow_ratings":"","article-allow_comments":"","show_author":"","show_create_date":"","show_modify_date":"","show_print_icon":"","show_email_icon":"","readmore":"","page_title":"","layout":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":""}', 0, '', ''),
(4, 0, 'Joomla! Beginners', 'joomla-beginners', '', '<p>If this is your first Joomla site or your first web site, you have come to the right place. Joomla will help you get your website up and running quickly and easily.</p>', '<p>', 1, 0, 0, 31, '2010-01-10 01:30:47', 42, '', '2010-01-10 01:45:47', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"1","link_titles":"0","show_intro":"","show_category":"0","link_category":"0","show_author":"0","show_create_date":"0","show_modify_date":"0","show_publish_date":"0","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 3, 0, 0, '', '', 1, 0, '{"robots":"","author":""}', 1, '', ''),
(5, 0, 'Upgraders', 'upgraders', '', '<p>If you are an experienced Joomla! 1.5 user, 1.6 will seem very familiar. There are new templates and improved user interfaces, but most functionality is the same. The biggest changes are improved access control (ACL), nested categories and comments.</p>', '<p><br /> The new user manager which will let you manage who has access to what in your site. You can leave access groups exactly the way you had them in Joomla 1.5 or make them as complicated as you want. You can learn more about how access control works [in this article] and on the [Joomla Documentation site].<br /> <br /> In Joomla 1.5 and 1.0 content was organized into sections and categories. In 1.6 sections are gone, and you can create categories within categories, going as deep as you want. You can learn more about how categories work in 1.6 [in this article] and [on the Joomla Documentation site].<br /> <br /> Comments are now integrated into all front end components. You can control what content has comments enable, who can comment, and much more. You can learn more about comments [in this article] and [on the Joomla Documentation site].<br /> <br /> All layouts have been redesigned to improve accessibility and flexibility. If you would like to keep the 1.5 layouts, you can find them in the html folder of the MilkyWay template. Simply copy the layouts you want to the html folder of your template.<br /> <br /> Updating your site and extensions when needed is easier than ever thanks to installer improvements.<br /> <br /> To learn more about how to move a Joomla 1.5 site to a Joomla 1.6 installation [read this].</p>', 1, 0, 0, 31, '2010-01-10 01:33:34', 42, '', '2010-01-10 01:42:20', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"1","link_titles":"0","show_intro":"","show_category":"0","link_category":"0","show_author":"0","show_create_date":"0","show_modify_date":"0","show_publish_date":"0","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 3, '{"robots":"","author":""}', 1, '', ''),
(6, 114, 'Designers and Developers', 'designers-and-developers', '', '<p>Joomla! 1.6 continues development of the Joomla Framework and CMS as a powerful and flexible way to bring your vision of the web to reality. With the administrator now fully MVC, the ability to control its look and the management of extensions is now complete.</p>\r\n', '\r\n<p> </p>\r\n<p>Languages files can now be overridden and working with multiple templates and overrides for the same views, creating the design you want is easier than it has ever been. Limiting support to PHP 5.x and above and ending legacy support for Joomla 1.0 makes Joomla lighter and faster than ever.</p>\r\n<p>Access control lists are now incorporated using a new system developed for Joomla. The ACL system is designed with developers in mind, so it is easy to incorporate into your extensions. The new nested sets libraries allow you to incorporate infinitely deep categories but also to use nested sets in a variety of other ways.</p>\r\n<p>A new forms library makes creating all kinds of user interaction simple. MooTools 1.2 provides a highly flexible javascript framework that is a major advance over MooTools 1.0.</p>\r\n<p><br /> New events throughout the core make integration of your plugins where you want them a snap.</p>\r\n<p>Learn about:</p>\r\n<ul>\r\n<li> [working with ACL] </li>\r\n<li> [working with nested sets] </li>\r\n<li> [integrating comments]</li>\r\n<li> [using the forms library] </li>\r\n<li> [working with Mootools 1.2] </li>\r\n<li> [using the override system] </li>\r\n<li> [Joomla! API]</li>\r\n<li> [Database] </li>\r\n<li> [Triggers] </li>\r\n<li> [Xmlrpc] </li>\r\n<li> [Installing and updating extensions]</li>\r\n<li>[Setting up your development environment]</li>\r\n</ul>', 1, 0, 0, 31, '2010-01-10 01:37:46', 42, '', '2010-03-26 14:22:30', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"1","link_titles":"","show_intro":"","show_category":"0","link_category":"0","show_parent_category":"","link_parent_category":"","show_author":"0","show_create_date":"0","show_modify_date":"0","show_publish_date":"0","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 5, 0, 0, '', '', 1, 7, '{"robots":"","author":"","rights":""}', 1, '', ''),
(7, 0, 'Sample Sites', 'sample-sites', '', '<p>Your installation includes sample data, designed to show you some of the options you have for building your website. In addition to information about Joomla! there are two sample "sites within a site" designed to help you get started with builidng your own site.</p><p>The first site is a simple site about <a href="index.php?option=com_content&view=article&catid=23&id=9">Australian Parks</a>. It shows you you an quickly and easily build a personal site with just the building blocks that are part of Joomla!. It includes a personal blog, weblinks, and a very simple image gallery.</p><p>The second site is more complex and represents what you might do if you are building a site for a small business, in this case a xxx shop.</p><p>In building either style site, or something completely different, you will probably want to add extensions and either create or purchase your own template. Many Joomla! users start off by modifying the templates that come with the core distribution so that they include special images and other design elements that relate to the site''s focus.</p>', '', 1, 0, 0, 31, '2010-01-10 01:59:13', 42, '', '2010-01-10 23:32:43', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 6, 0, 0, '', '', 1, 34, '{"robots":"","author":""}', 0, '', ''),
(8, 0, 'Components', 'components', '', '<p>Components are larger extensions that produce the major content for your site. Each component has one or more "views" that control how content is displayed.</p><p>', '<p>In the Joomla! administrator there are additional extensions suce as Menus, Redirection, and the extension managers.</p>', 1, 0, 0, 32, '2010-01-10 02:07:38', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 22, '{"robots":"","author":""}', 0, '', ''),
(9, 0, 'Australian Parks', 'australian-parks', '', '<div style="border: 1px solid black; background-image: url(images/sampledata/Parks/other/729px-Australia_satellite_plane.jpg);"><div style="margin-top: 100px; font-family: georgia,serif; font-size: 200%; color: white; line-height: 250%; margin-left: 100px; margin-right: 100px;"><p>Welcome!</p><p>This is a basic site about the beautiful and fascinating parks of Australia.</p><p>This site should give you some ideas about what you can do to set up a simple personal Joomla! site on a topic you are interested in.</p></div>', '', 1, 0, 0, 23, '2010-01-10 05:41:55', 42, '', '2010-01-10 20:27:11', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 19, '{"robots":"","author":""}', 0, '', ''),
(10, 0, 'Content', 'content', '', '<p>The content component (com_content) is what you use to write articles. It is extremely flexible and has the largest number of built in views.</p>', '', 1, 0, 0, 39, '2010-01-10 12:50:35', 42, '', '2010-01-10 16:51:40', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 4, '{"robots":"","author":""}', 0, '', ''),
(11, 0, 'Weblinks', 'weblinks', '', '<p>Weblinks (com_weblinks) is a component that provides a structured way to organize external links and present them in a visually attractive, consistent and informative way.', '', 1, 0, 0, 39, '2010-01-10 12:58:33', 42, '', '2010-01-10 16:52:23', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 5, '{"robots":"","author":""}', 0, '', ''),
(12, 0, 'News Feeds', 'news-feeds', '', '<p>News Feeds (com_newsfeeds) provides a way to organize and present news feeds. News feeds are a way that you present information from another site on your site. For example, the joomla.org website has numerous feeds that you an incorporate on your site. You an use menus to present a single feed, a list of feeds in a category, or or a list of all feed categories.</p>', '', 1, 0, 0, 39, '2010-01-10 13:08:52', 42, '', '2010-01-10 16:51:57', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 3, '{"robots":"","author":""}', 0, '', ''),
(13, 0, 'Contacts', 'contacts', '', '<p>The contact component provides a way to provide contact forms and information for your site or to create a most complex directory that can be used for many different purposes.', '', 1, 0, 0, 39, '2010-01-10 13:19:46', 42, '', '2010-01-10 16:51:24', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 12, '{"robots":"","author":""}', 0, '', ''),
(14, 0, 'Users Component', 'users-component', '', '<p>The users extension lets your site visitors register, login and logout, change their passwords and other information, and recover lost passwords.</p>', '', 1, 0, 0, 39, '2010-01-10 14:00:05', 42, '', '2010-01-10 16:52:10', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 2, '{"robots":"","author":""}', 0, '', ''),
(15, 0, 'Modules', 'modules', '', '<p>About modules</p>', '', 1, 0, 0, 32, '2010-01-10 14:00:55', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 1, '{"robots":"","author":""}', 0, '', ''),
(16, 0, 'Templates', 'templates', '', '<p>about templates</p>', '', 1, 0, 0, 32, '2010-01-10 14:01:47', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 1, '{"robots":"","author":""}', 0, '', ''),
(17, 0, 'Languages', 'languages', '', '<p>Joomla! installs in English, but there are translations of the interfaces, sample data and help screens are available in dozens of languages.</p><p><a href="http://community.joomla.org/translations.html">Translation information</a></p><p>If there is no language pack available for your language, instructions are available for creating your own translation, which you can also contribute to the community by starting a translation team to create an accredited translation.</p><p>Translations are installed the the extensions manager in the site administrator and then managed using the language manager.</p>', '', 1, 0, 0, 32, '2010-01-10 14:02:22', 42, '', '2010-01-11 15:29:23', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 11, '{"robots":"","author":""}', 0, '', ''),
(18, 0, 'Plugins', 'plugins', '', '<p>Plugins are small task oriented extensions that enhance the Joomla! framework.</p><p>Some are associated with particular extensions and others, such as editors, are used across all of Joomla!. Most beginning users do not need to change any of the plugins that install with Joomla!.</p><p>', '', 1, 0, 0, 32, '2010-01-10 14:03:17', 42, '', '2010-01-11 15:38:34', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 17, '{"robots":"","author":""}', 0, '', ''),
(19, 0, 'Administrator Components', 'administrator-components', '', '<p>All components also are used in the administrator area of your website. In addition to the ones listed here, there are components in the administrator that do not have direct front end displays. The most important ones for most users are:</p><ul><li>Media Manager</li><li>Extensions Manager</li><li>Menu Manager</li><li>Configuration</li><li>Banners</li></ul>', '<h3>Media Manager</h3><h3>Extensions Manager</h3><h3>Menu Manager</h3><h3>Configuration</h3><h3>Banners</h3>', 1, 0, 0, 39, '2010-01-10 15:28:15', 42, '', '2010-01-10 15:29:45', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 2, '{"robots":"","author":""}', 0, '', ''),
(20, 0, 'Search Component', 'search-component', '', '<p>The search component proviedes basic search functionality for the information contained in your core components. Many third part extensions also can be searched by the search component.</p>', '', 1, 0, 0, 39, '2010-01-10 15:45:55', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 5, '{"robots":"","author":""}', 0, '', ''),
(21, 0, 'The Joomla! Project', 'the-joomla-project', '', '<p>All about the Joomla! Project</p>', '', 1, 0, 0, 31, '2010-01-10 15:53:36', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":""}', 0, '', ''),
(22, 0, 'The Joomla! Community', 'the-joomla-community', '', '<p>Landing Page for Joomla! Community information</p>', '', 1, 0, 0, 34, '2010-01-10 16:00:04', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 4, '{"robots":"","author":""}', 0, '', ''),
