(45, 80, 'Modules', 'modules', '', '<p>Modules are small blocks of content that can be displayed in positions on a web page. The menus on this site are displayed in modules.</p>\r\n<p>The core of Joomla! includes 17 separate modules ranging from login to search to random images.</p>\r\n<p>Each module has a name that starts mod_ but when it displays it has a title. In the descriptions in this section, the titles are the same as the names.</p>\r\n', '', 1, 0, 0, 40, '2010-01-11 08:16:25', 42, '', '2010-03-05 17:16:00', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 31, '{"robots":"","author":"","rights":""}', 0, '', ''),
(46, 0, 'Templates', 'templates', '', '<p>Templates are extensions that create the look and fell of your site. Two different templates can completely transform the experience of viewing the same content.</p><p>The basic Joomla! installation includes four templates, but there are thousands of other ready made templates available or you can design your own.</p>', '<p></p>', 0, 0, 0, 41, '2010-01-11 08:48:44', 42, '', '2010-01-11 08:51:11', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 14, '{"robots":"","author":""}', 0, '', ''),
