(54, 0, 'What''s New in 1.5?', 'whats-new-in-15', '', '', '<p>As with previous releases, Joomla! provides a unified and easy-to-use framework for delivering content for Web sites of all kinds. To support the changing nature of the Internet and emerging Web technologies, Joomla! required substantial restructuring of its core functionality and we also used this effort to simplify many challenges within the current user interface. Joomla! 1.5 has many new features.</p><p style="margin-bottom: 0in;">In Joomla! 1.5, you''ll notice:</p>Substantially improved usability, manageability, and scalability far beyond the original Mambo foundations</p><p>Expanded accessibility to support internationalisation, double-byte characters and right-to-left support for Arabic, Farsi, and Hebrew languages among others</p></li><li>Extended integration of external applications through Web services and remote authentication such as the Lightweight Directory Access Protocol (LDAP)</p></li><li>Enhanced content delivery, template and presentation capabilities to support accessibility standards and content delivery to any destination</p></li>n<li><p >A more sustainable and flexible framework for Component and Extension developers</p></li><li><p>Backward compatibility with previous releases of Components, Templates, Modules, and other Extensions</p></li></ul>', -1, 0, 0, 31, '2010-01-12 03:51:04', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","page_title":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":""}', 0, '', ''),
