(66, 62, 'Articles Modules', 'content-modules', '', '<p>Content modules display article and other information from the content component.</p>\r\n', '', 1, 0, 0, 40, '2010-03-04 00:05:49', 42, '', '2010-03-05 16:00:49', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 3, 0, 0, '', '', 1, 30, '{"robots":"","author":"","rights":""}', 0, '', ''),
(67, 63, 'User Modules', 'user-modules', '', '<p>User modules interact with the user system, allowing users to login, showing who is logged in, and showing the most recently registered users.</p>\r\n', '\r\n<p> </p>', 1, 0, 0, 40, '2010-03-04 01:25:09', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 9, '{"robots":"","author":"","rights":""}', 0, '', ''),
(68, 64, 'Display Modules', 'display-modules', '', '<p>These modules display information from other components.</p>\r\n', '\r\n<p> </p>', 1, 0, 0, 40, '2010-03-04 01:56:54', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 5, '{"robots":"","author":"","rights":""}', 0, '', ''),
(69, 65, 'Utility Modules', 'utility-modules', '', '<p>Utility modules provide useful functionality such as search,  syndication, and statistics.</p>\r\n', '\r\n<p> </p>', 1, 0, 0, 40, '2010-03-04 03:24:05', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 13, '{"robots":"","author":"","rights":""}', 0, '', ''),
(70, 66, 'Menus', 'menus', '', '<p>Menus provide navigation and structure to your site. <br /><br /></p>\r\n', '', 1, 0, 0, 40, '2010-03-04 03:36:41', 42, '', '2010-03-04 03:46:47', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 3, 0, 0, '', '', 1, 11, '{"robots":"","author":"","rights":""}', 0, '', ''),
