(72, 68, 'Weblinks Module', 'weblinks-module', '', '<p>This module displays the list of weblinks in a category.</p>\r\n<p>{loadposition weblinksload}</p>\r\n', '', 1, 0, 0, 40, '2010-03-04 03:49:23', 42, '', '2010-03-14 20:15:50', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 3, 0, 0, '', '', 1, 9, '{"robots":"","author":"","rights":""}', 0, '', ''),
(73, 69, 'Breadcrumbs', 'breadcrumbs', '', '<p>Breadcrumbs provide a pathway for users to navigate through the site.</p>\r\n<p>{loadposition breadcrumbsload}</p>\r\n', '\r\n<p> </p>', 1, 0, 0, 40, '2010-03-04 03:54:50', 42, '', '2010-03-05 15:59:31', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 4, 0, 0, '', '', 1, 11, '{"robots":"","author":"","rights":""}', 0, '', ''),
(74, 87, 'Template 1', 'template-1', '', '<p>This is a template for a personal site.</p>\r\n<p>It features ....</p>\r\n<p>[screen shot}</p>\r\n', '', 1, 0, 0, 41, '2010-03-14 15:09:03', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 4, '{"robots":"","author":"","rights":""}', 0, '', ''),
(75, 88, 'Template 2', 'template-2', '', '<p>This is a template for a business site.</p>\r\n<p>It features ..</p>\r\n<p>[screen shot]</p>\r\n', '', 1, 0, 0, 41, '2010-03-14 15:09:55', 42, '', '2010-03-14 15:10:00', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 3, 0, 0, '', '', 1, 4, '{"robots":"","author":"","rights":""}', 0, '', ''),
(76, 89, 'Atomic', 'atomic', '', '<p>Atomic is a minimal template designed to be a skeleton for making your own template and to learn about Joomla! templating.</p>\r\n<p>[screen shot]</p>\r\n', '', 1, 0, 0, 41, '2010-03-14 15:13:33', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 6, '{"robots":"","author":"","rights":""}', 0, '', ''),
(77, 90, 'Syndicate', 'syndicate', '', '<p>The syndicate module allows you to display a link that allows users to take a feed from your site. It will only display on pages for which feeds are possible. That means it will not display on single article, contact or weblinks pages, such as this one.</p>\r\n<p>[screen shot]</p>\r\n<p>{loadposition syndicateload}</p>\r\n', '', 1, 0, 0, 40, '2010-01-11 01:05:22', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":""}', 0, '', ''),
(78, 91, 'Milky Way', 'milky-way', '', '<p>Milky Way is the default template for Joomla! 1.5. You can find all of the old layouts in the _html folder if you need them for your upgraded sites.</p>\r\n<p><img src="templates/rhuk_milkyway/template_thumbnail.png" border="0" alt="Milky Way Image" width="206" height="150" style="vertical-align: middle;" /></p>\r\n', '', 1, 0, 0, 41, '2010-03-14 15:17:02', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 7, '{"robots":"","author":"","rights":""}', 0, '', ''),
(79, 112, 'Fruit Shop', 'fruit-shop', '', '<h1>Welcome to the Fruit Shop</h1>\r\n<p style="padding-left: 30px;"><em><br /></em></p>\r\n<p>We sell fruits from around the world. Please use our website to learn more about our business. We hope you will come to our shop and buy some fruit.</p>\r\n<p style="padding-left: 30px;"><em><span style="font-style: normal;"><em>This mini site will show you how you might want to set up a site for a business, in this case one selling fruit. It shows how to use access controls to manage your site content. If you were building a real site, you would might want to extend it with e-commerce, a catalog, mailing lists or other enhancements, many of which are available through the</em><a href="http://extensions.joomla.org" style="color: #1b57b1; text-decoration: none; font-weight: normal;"><em> Joomla! Extensions Directory</em></a><em>.</em></span></em></p>\r\n<p style="padding-left: 30px;"><em><span style="font-style: normal;"><em>To understand this site you will probably want to make one user with groups set to customer and one with group set to grower. By logging in with different privileges  you can see how access control works.</em></span></em></p>\r\n<p style="padding-left: 30px;"><em><span style="font-style: normal;"><em><br /></em></span></em></p>\r\n', '', 1, 0, 0, 75, '2010-03-22 00:32:45', 42, '', '2010-03-26 16:46:55', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 4, 0, 0, '', '', 1, 31, '{"robots":"","author":"","rights":""}', 0, '', ''),
(80, 115, 'Happy Orange Orchard', 'happy-orange-orchard', '', '<p>At our orchard we grow the world''s best oranges as well as other citrus fruit such as lemons and grapefruit. Our family has been tending this orchard for generations.</p>\r\n', '', 1, 0, 0, 76, '2010-03-26 14:34:21', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 11, '{"robots":"","author":"","rights":""}', 0, '', ''),
(81, 116, 'Wonderful Watermelon', 'wonderful-watermelon', '', '<p>Watermelon is a wonderful and healthy treat. We grow the world''s sweetest watermelon. We have the largest watermelon patch in our country.</p>\r\n', '', 1, 0, 0, 76, '2010-03-26 14:44:26', 44, '', '2010-03-26 15:34:22', 42, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 3, 0, 0, '', '', 1, 4, '{"robots":"","author":"","rights":""}', 0, '', ''),
(82, 117, 'Directions', 'directions', '', '<p>Here''s how to find our shop.</p>\r\n<p> </p>\r\n<p>By car</p>\r\n<p>By foot</p>\r\n<p>By bus</p>\r\n<p> </p>\r\n', '', 1, 0, 0, 75, '2010-03-26 16:26:52', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_readmore":"","show_print_icon":"","show_email_icon":"","show_hits":"","page_title":"","alternative_readmore":"","layout":"","article-allow_ratings":"","article-allow_comments":""}', 2, 0, 0, '', '', 1, 4, '{"robots":"","author":"","rights":""}', 0, '', '');
